Storyline

Undercover cop Lucas White joins Vin Serento's LA gang of illegal 
street racers. They are fast and they are furious and they plan to 
double cross LA crime kingpin Juan Carlos de la Sol who hides his 
cash in a downtown Taco Bell. The gangs outrageous plan is as daring 
as it is ridiculous and will see them towing the whole damn restaurant, 
at crazy speeds.


